insert into taglog(tag,tweet,tweetId) values ('きよログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">アンリシャルパンティエでチョコロールケーキを購入したら<br><br>レジのおばさまに<br><br>「きよログ掲載してくださいねー」<br><br>と言われました、、。笑<br><br>、、なんて日だ<br><br>1700円ほどとリーズナブルですが、生地もふわふわでチョコクリームも濃厚で美味です<a href="https://twitter.com/hashtag/%E3%81%8D%E3%82%88%E3%83%AD%E3%82%B0?src=hash">#きよログ</a> <a href="https://t.co/9SoEa64eji">pic.twitter.com/9SoEa64eji</a></p>&mdash; Kiyoto (@KiyotoDrives) <a href="https://twitter.com/KiyotoDrives/status/844548753801437185">2017年3月22日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',844548753801437185);
insert into taglog(tag,tweet,tweetId) values ('きよログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">最強の3時のおやつ (ぼく調べ)<br><br>白金高輪<br>「メゾンダーニ」のフィナンシェ<br><br>売り切れていたので焼き立てを予約して再訪<br><br>15時に合わせて購入<br><br>重厚なバター感、厚み、焼き目の香ばしさ<br><br>食べ終わったら仕入れるようにまた買いに行く、ぼく、、。<a href="https://twitter.com/hashtag/%E3%81%8D%E3%82%88%E3%83%AD%E3%82%B0?src=hash">#きよログ</a> <a href="https://t.co/Jh698iHqUh">pic.twitter.com/Jh698iHqUh</a></p>&mdash; Kiyoto (@KiyotoDrives) <a href="https://twitter.com/KiyotoDrives/status/843350677136986112">2017年3月19日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',843350677136986112);
