insert into taglog(tag,tweet,tweetId) values ('ユウ飯', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">六本木バー「THE PUBLIC SIX TOKYO」<br><br>デートでも仲間同士でもOKなシックでお洒落なバー。定番のお酒に加えてクラフトビール、日本酒もあり、食べ物やデザートも充実。月〜土は翌5:00迄、日祝は翌3:00迄。覚えておいて損はしない六本木のオールラウンダー<a href="https://twitter.com/hashtag/%E3%83%A6%E3%82%A6%E9%A3%AF?src=hash">#ユウ飯</a> <a href="https://t.co/2EpMkyDPKW">pic.twitter.com/2EpMkyDPKW</a></p>&mdash; 柊ユウ (@yuhiiragi_pj) <a href="https://twitter.com/yuhiiragi_pj/status/825656531001618433">2017年1月29日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',825656531001618433);
