insert into taglog(tag,tweet,tweetId) values ('ちわログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">新宿思い出横丁の『もつ焼き ウッチャン』に行って来ました！✨<br>人生初の赤提灯です🏮✨<br>16時に行ったんですが既に行列で驚き！！(๑•ૅㅁ•๑)✨さすが人気店！✨お酒が進むメニューばっかりでたくさん飲んでしまいました💦<br>赤提灯ハマりそうです！💕<br>Instagram【<a href="https://twitter.com/hashtag/%E3%81%A1%E3%82%8F%E3%83%AD%E3%82%B0?src=hash">#ちわログ</a>】 <a href="https://t.co/38fYpCgiXv">pic.twitter.com/38fYpCgiXv</a></p>&mdash; みきチワワ (@mikichiwa111) <a href="https://twitter.com/mikichiwa111/status/808300109993680898">2016年12月12日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',808300109993680898);
