insert into taglog(tag,tweet,tweetId) values ('ちわログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">恵比寿『黄金屋 隠れ艶』<br>完全個室で落ち着いたお店でした！<br>人気店なだけあって9時半過ぎても予約のお客さんでいっぱいでお店を出なきゃいけない時間になってしまい〆の雑炊が食べれなかったのが心残り！<br>こってりが食べたい気分だったので味噌を選びました♪<br>Instagram【<a href="https://twitter.com/hashtag/%E3%81%A1%E3%82%8F%E3%83%AD%E3%82%B0?src=hash">#ちわログ</a>】 <a href="https://t.co/bEk3Gn9T0J">pic.twitter.com/bEk3Gn9T0J</a></p>&mdash; みきチワワ (@mikichiwa111) <a href="https://twitter.com/mikichiwa111/status/813327011825340416">2016年12月26日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',813327011825340416);
insert into taglog(tag,tweet,tweetId) values ('ちわログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">千駄ヶ谷『Goodmorning Cafe』<br>グッドモーニングカフェはなんと、名前の通り朝7:00からオープンしてるとっても早起きなカフェなんです☀️✨私は今回ランチタイムに行きましたが、次はもっと早起きしてここのアサイボール食べてみたいです💕✨<br>Instagram【<a href="https://twitter.com/hashtag/%E3%81%A1%E3%82%8F%E3%83%AD%E3%82%B0?src=hash">#ちわログ</a>】 <a href="https://t.co/sTIt93oedG">pic.twitter.com/sTIt93oedG</a></p>&mdash; みきチワワ (@mikichiwa111) <a href="https://twitter.com/mikichiwa111/status/819559753265258496">2017年1月12日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',819559753265258496);
insert into taglog(tag,tweet,tweetId) values ('ちわログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">浜松町『焼肉 くにもと 新館』<br>に行って来ました！✨<br>どれも美味しくて感動の連続。。😹✨💕ここの名物でもある湯びきが最高に美味しかったです！😹✨💕そしてここの切り落としのコリアンダレが絶品！✨旨辛でご飯がススム一品です！😭✨ここハマる😹✨<br>Instagram【<a href="https://twitter.com/hashtag/%E3%81%A1%E3%82%8F%E3%83%AD%E3%82%B0?src=hash">#ちわログ</a>】 <a href="https://t.co/8GAuMp4uAI">pic.twitter.com/8GAuMp4uAI</a></p>&mdash; みきチワワ (@mikichiwa111) <a href="https://twitter.com/mikichiwa111/status/820226274475945985">2017年1月14日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',820226274475945985);
insert into taglog(tag,tweet,tweetId) values ('ちわログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">新宿『赤から』<br>クチコミでよく聞いていたけど、まだ行ったことなかったので行ってきました！🍲辛いのは平気なタイプだけど友人に合わせて辛さレベル3🔥5〜7くらいは行けた気がする🤔これぞ旨辛って感じ！😋✨しかも安い！最後はチーズリゾットにして頂きました😋Instagram【<a href="https://twitter.com/hashtag/%E3%81%A1%E3%82%8F%E3%83%AD%E3%82%B0?src=hash">#ちわログ</a>】 <a href="https://t.co/qkkrkQ0PUo">pic.twitter.com/qkkrkQ0PUo</a></p>&mdash; みきチワワ (@mikichiwa111) <a href="https://twitter.com/mikichiwa111/status/823046009328570368">2017年1月22日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',823046009328570368);
insert into taglog(tag,tweet,tweetId) values ('ちわログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">中目黒『鶏だしおでん さもん』<br>中目黒高架下にあるおでん屋さん🍢<br>お店の前を通ったら美味しそうなおでんの出汁の匂いで引き寄せられました！✨鶏だしで約4時間煮込んだ大根は、お店の自慢だそうです！大根の甘みがしっかり出ていてとても美味しかったです✨<br>Instagram【<a href="https://twitter.com/hashtag/%E3%81%A1%E3%82%8F%E3%83%AD%E3%82%B0?src=hash">#ちわログ</a>】 <a href="https://t.co/tCiGPy4rjk">pic.twitter.com/tCiGPy4rjk</a></p>&mdash; みきチワワ (@mikichiwa111) <a href="https://twitter.com/mikichiwa111/status/824254426231644160">2017年1月25日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',824254426231644160);
insert into taglog(tag,tweet,tweetId) values ('ちわログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">新宿『龍の家』<br>いつも行列が出来ている繁盛店🍜ここのつけ麺はモツが入っていて焦がし油の香りと、とんこつベースのつけ汁が最高にマッチしていて最後はお粥でシメる他の店とは違った面白い食べ方！つけ麺食べたいなぁ〜と思ったら真っ先に思い浮かぶお店がここ！<br>Instagram【<a href="https://twitter.com/hashtag/%E3%81%A1%E3%82%8F%E3%83%AD%E3%82%B0?src=hash">#ちわログ</a>】 <a href="https://t.co/DUCkZqlmCr">pic.twitter.com/DUCkZqlmCr</a></p>&mdash; みきチワワ (@mikichiwa111) <a href="https://twitter.com/mikichiwa111/status/827866737563492353">2017年2月4日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',827866737563492353);
insert into taglog(tag,tweet,tweetId) values ('ちわログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">恵比寿『虎の穴』<br>今年３回目の虎の穴！（笑）<br>たまたま連れてきてもらった店が私の一番大好きな焼肉屋だというミラクルが起きた！w ずっと行きたがってた友人も美味しい〜！💕✨ここの店のメニュー全部美味しいけどハラミにかける秘伝のタレが最高に美味です！<br>Instagram【<a href="https://twitter.com/hashtag/%E3%81%A1%E3%82%8F%E3%83%AD%E3%82%B0?src=hash">#ちわログ</a>】 <a href="https://t.co/3fTfKsJyBK">pic.twitter.com/3fTfKsJyBK</a></p>&mdash; みきチワワ (@mikichiwa111) <a href="https://twitter.com/mikichiwa111/status/828215447472394240">2017年2月5日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',828215447472394240);
insert into taglog(tag,tweet,tweetId) values ('ちわログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">湯島『一輪咲いても花は花』<br>友人に連れてってもらい楽しみにしていたお店へ！✨美味しいホルモンを出してくれると有名なお店ですが、ホルモンだけじゃなく他のメニューもとっても美味しいです！✨そして、ここの炊き込みご飯は感動モノです😹💕✨食べてみたい方は事前に要予約！📞<br>【<a href="https://twitter.com/hashtag/%E3%81%A1%E3%82%8F%E3%83%AD%E3%82%B0?src=hash">#ちわログ</a>】 <a href="https://t.co/CTDm2CSTDu">pic.twitter.com/CTDm2CSTDu</a></p>&mdash; みきチワワ (@mikichiwa111) <a href="https://twitter.com/mikichiwa111/status/829688138469564417">2017年2月9日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',829688138469564417);
insert into taglog(tag,tweet,tweetId) values ('ちわログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">北参道『Korot 』<br>今日はバレンタイン💝ということで、お世話になっている会社の上司や先輩方に購入！ここはよくお世話になってます♪甘さ控え目でクレープの生地はモチモチで美味しいです✨いろんなバリエーションがあって迷います☺️男性陣も女性陣も喜んでくれました💕✨<br>【<a href="https://twitter.com/hashtag/%E3%81%A1%E3%82%8F%E3%83%AD%E3%82%B0?src=hash">#ちわログ</a> 】 <a href="https://t.co/TlbRH0t91w">pic.twitter.com/TlbRH0t91w</a></p>&mdash; みきチワワ (@mikichiwa111) <a href="https://twitter.com/mikichiwa111/status/831494261975552000">2017年2月14日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',831494261975552000);
