insert into taglog(tag,tweet,tweetId) values ('食べ6', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">銀座にも喫茶店があるコレド室町2「炭火焙煎珈琲 凛」<br>コクと深みがあるのにサッパリとした味わいのアイスコーヒー(カフェインレス)をテイクアウトしたら抽出法を読みつつ福徳神社で参拝⛩ <a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B96?src=hash">#食べ6</a> <a href="https://t.co/FZASQpG8lS">pic.twitter.com/FZASQpG8lS</a></p>&mdash; ⑥ (@num_ber6) <a href="https://twitter.com/num_ber6/status/854576474111725569">2017年4月19日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',854576474111725569);
