insert into taglog(tag,tweet,tweetId) values ('食べ6', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">女子へのお土産で高評価を得ている苺スイーツ専門店「オードリー」<br>有名なお菓子は夕方には完売…<br>中でも自分用にまで買うほど好きなのはバニラクリーム&amp;ベリーのブッセ「キュートベリー」ふわっふわな生地にさっぱり甘くないクリームとしっかりした味わいのベリーのコラボは最高☺️<br> <a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B96?src=hash">#食べ6</a> <a href="https://t.co/A1O89gIt7Z">pic.twitter.com/A1O89gIt7Z</a></p>&mdash; ⑥ (@num_ber6) <a href="https://twitter.com/num_ber6/status/849438010018082817">2017年4月5日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',849438010018082817);
