insert into taglog(tag,tweet,tweetId) values ('食べ6', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">シャクシャク味わえる信州りんごがゴロッと入ったアップルパイと柔らかく甘いバナナパイ。どちらもスッキリとしたカスタード入り。<br>マミーズアンスリールは定番の美味しさ。<br> <a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B96?src=hash">#食べ6</a> <a href="https://t.co/VhCNagQW0I">pic.twitter.com/VhCNagQW0I</a></p>&mdash; ⑥ (@num_ber6) <a href="https://twitter.com/num_ber6/status/847008476463153152">2017年3月29日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',847008476463153152);
insert into taglog(tag,tweet,tweetId) values ('食べ6', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">目黒とんかつ御三家(全てヒレ)<br>「とんき」塩無し。辛子かソースで。定食につく豚汁が絶品。<br>「かつ壱」キャベツが大量。しっかりした肉質で食べ応え◎<br>「大宝」ヒレカツ単品で頼めるので少食には嬉しい。御三家の中で一番肉質が柔らかい。店内はかなり狭いけど再訪率高いお店です。<br> <a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B96?src=hash">#食べ6</a> <a href="https://t.co/TcTTNTweGx">pic.twitter.com/TcTTNTweGx</a></p>&mdash; ⑥ (@num_ber6) <a href="https://twitter.com/num_ber6/status/844438378913390592">2017年3月22日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',844438378913390592);
insert into taglog(tag,tweet,tweetId) values ('食べ6', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">今日のおやつはエシレメゾンデュプールのクロワッサン。<br>奥は有塩、外側パリパリで中はふっくらしっとり。手前は食塩不使用、中までほばパリッパリ。2つとも一口目からバターがじゅわっとお口に広がって幸せになります。<br>私の中でキングオブクロワッサンに輝きました🥐✨<a href="https://twitter.com/hashtag/%E9%A3%9F%E3%81%B96?src=hash">#食べ6</a> <a href="https://t.co/zpZqjueUA9">pic.twitter.com/zpZqjueUA9</a></p>&mdash; ⑥ (@num_ber6) <a href="https://twitter.com/num_ber6/status/834302886221787136">2017年2月22日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',834302886221787136);
