insert into taglog(tag,tweet,tweetId) values ('ちょこログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">銀座「ヴァンピックル」フレンチ炭火焼き、ビストロ<br><br>狭い！安い！美味い！の三拍子です！<br>ワインもお手頃価格なんだよね。種類もそこそこあるし<br>平均的な人なら1人5,000円ぐらいで呑み喰い出切ると思う<br>穴子串は是非、食べてほしい(*´ω｀*)<a href="https://twitter.com/hashtag/%E3%81%A1%E3%82%87%E3%81%93%E3%83%AD%E3%82%B0?src=hash">#ちょこログ</a> <a href="https://t.co/IzMfdl0CVz">pic.twitter.com/IzMfdl0CVz</a></p>&mdash; ちょこ (@chxco) <a href="https://twitter.com/chxco/status/793052486860845056">2016年10月31日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',793052486860845056);
insert into taglog(tag,tweet,tweetId) values ('ちょこログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">六本木駅「サロンドグー」フレンチ、洋食<br>全席半個室のフレンチっぽい洋食屋さん<br>ここのトリュフクレープが、めっちゃ美味しいの…1回食べたら忘れられなくなりますよ。<br>高級食材をふんだんに使った洋食屋さんです。はい(*´ω｀*)❤︎<a href="https://twitter.com/hashtag/%E3%81%A1%E3%82%87%E3%81%93%E3%83%AD%E3%82%B0?src=hash">#ちょこログ</a> <a href="https://t.co/V99h4Tjlif">pic.twitter.com/V99h4Tjlif</a></p>&mdash; ちょこ (@chxco) <a href="https://twitter.com/chxco/status/789432989281193984">2016年10月21日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',789432989281193984);
insert into taglog(tag,tweet,tweetId) values ('ちょこログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">錦糸町駅「純手打ち讃岐うどん 五郎」<br>水、だし、粉にこだわった本場の讃岐うどん…麺がもったりしてて最高に美味しい。都内で3位には入る美味しさ。いつも、あつあつ小350円とり天120円卵130円頼んでます。ランチは並ぶけど回転早いので待っててもすぐ入れます。<a href="https://twitter.com/hashtag/%E3%81%A1%E3%82%87%E3%81%93%E3%83%AD%E3%82%B0?src=hash">#ちょこログ</a> <a href="https://t.co/6THiSV5Jyh">pic.twitter.com/6THiSV5Jyh</a></p>&mdash; ちょこ (@chxco) <a href="https://twitter.com/chxco/status/786409697414750211">2016年10月13日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',786409697414750211);
insert into taglog(tag,tweet,tweetId) values ('ちょこログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr"><a href="https://twitter.com/hashtag/%E3%81%A1%E3%82%87%E3%81%93%E3%83%AD%E3%82%B0?src=hash">#ちょこログ</a> さんオススメの『渋谷 オステリアウララ』に行ってきたよ〜！<br>食材を選ぶって形の注文方法は斬新でした〜♡そしてリーズナブル♡(<a href="https://twitter.com/hashtag/%E3%81%B5%E3%81%BF%E9%A3%AF?src=hash">#ふみ飯</a>) <a href="https://t.co/DJ7bKSCNQU">pic.twitter.com/DJ7bKSCNQU</a></p>&mdash; 夜野 ふみ (@yorunofumi) <a href="https://twitter.com/yorunofumi/status/785654353805705217">2016年10月11日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',785654353805705217);
insert into taglog(tag,tweet,tweetId) values ('ちょこログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">横浜駅「吉村家」<br>家系総本山へ参拝しに行って来ました！<br>70名待ち50分…<br>入れ替え制だから早く順番がまわってくるのかな…<br>美味しかった(*´∀｀*)<a href="https://twitter.com/hashtag/%E3%81%A1%E3%82%87%E3%81%93%E3%83%AD%E3%82%B0?src=hash">#ちょこログ</a> <a href="https://t.co/IK2YKW0U04">pic.twitter.com/IK2YKW0U04</a></p>&mdash; ちょこ (@chxco) <a href="https://twitter.com/chxco/status/785339383620571141">2016年10月10日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',785339383620571141);
insert into taglog(tag,tweet,tweetId) values ('ちょこログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">渋谷駅「オステリアウララ」<br>メニューが無いイタリアン<br>食材をチョイス→調理方法を決める！<br>なので料理とか、食べるのが本当に好きな人が行ったら楽しめるお店<br>詳しく無い人が行くとメニューが無いので逆に困るかも？<br>一応、店員さんが優しく対応してくれます。<a href="https://twitter.com/hashtag/%E3%81%A1%E3%82%87%E3%81%93%E3%83%AD%E3%82%B0?src=hash">#ちょこログ</a> <a href="https://t.co/m6PAX0ul16">pic.twitter.com/m6PAX0ul16</a></p>&mdash; ちょこ (@chxco) <a href="https://twitter.com/chxco/status/782921217120403456">2016年10月3日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',782921217120403456);
