insert into taglog(tag,tweet,tweetId) values ('ちょこログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">赤坂駅「燻」隠れ家レストラン<br><br>お通しの燻製チーズ美味しい…名前の通り燻製系が得意<br>〆のフォアグラオムライス最高に美味しかった…お酒の種類も豊富だしお酒と美味しい料理が好きな人は是非…！！！<a href="https://twitter.com/hashtag/%E3%81%A1%E3%82%87%E3%81%93%E3%83%AD%E3%82%B0?src=hash">#ちょこログ</a> <a href="https://t.co/ptl1WkM8Gf">pic.twitter.com/ptl1WkM8Gf</a></p>&mdash; ちょこ (@chxco) <a href="https://twitter.com/chxco/status/774214161957912577">2016年9月9日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',774214161957912577);
insert into taglog(tag,tweet,tweetId) values ('ちょこログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">飯田橋、神楽坂「しゅうご」イタリアン<br><br>隠れ家イタリアン、見たまんまボリュームたっぷりです。<br>値段もそんなに高くないです。2人で1万ちょっとだったかな<br>深夜2:30がLOなので遅い時間の飲み会やデートにピッタリです！<a href="https://twitter.com/hashtag/%E3%81%A1%E3%82%87%E3%81%93%E3%83%AD%E3%82%B0?src=hash">#ちょこログ</a> <a href="https://t.co/cmNkoHN6NS">pic.twitter.com/cmNkoHN6NS</a></p>&mdash; ちょこ (@chxco) <a href="https://twitter.com/chxco/status/771318826172416000">2016年9月1日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',771318826172416000);
insert into taglog(tag,tweet,tweetId) values ('ちょこログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">飯田橋、神楽坂駅「OSAKA きっちん」鉄板焼き<br><br>コース、アラカルトもあって少量ずつ出してくれるのでアルコール好きにはたまらない<br>軽い感じで食べるのに是非！！<a href="https://twitter.com/hashtag/%E3%81%A1%E3%82%87%E3%81%93%E3%83%AD%E3%82%B0?src=hash">#ちょこログ</a> <a href="https://t.co/b7Z9Bh52xD">pic.twitter.com/b7Z9Bh52xD</a></p>&mdash; ちょこ (@chxco) <a href="https://twitter.com/chxco/status/768754494255484928">2016年8月25日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',768754494255484928);
insert into taglog(tag,tweet,tweetId) values ('タグはまだない', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">【浅草 花月堂】<br>言わずと知れた超名店♡週末になると1日3000個以上も売れる、とんでもないぐらい大人気店😼✨<br>名物の元祖ジャンボメロンパンは外はカリッカリ中はフワッフワで食べたらやみつきになる美味しさ😻👍✨あまりのフワフワ加減に袋には「やわらか注意」と記載されるほど🙀❤️ <a href="https://t.co/2HeBRXTJ2h">pic.twitter.com/2HeBRXTJ2h</a></p>&mdash; ももちゃん (@shosha__girl) <a href="https://twitter.com/shosha__girl/status/854296758112854016">2017年4月18日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',854296758112854016);
insert into taglog(tag,tweet,tweetId) values ('タグはまだない', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">【きのした 恵比寿はなれ】<br>TKO木下が経営してる鉄板料理屋さん😻オススメは何と言っても鉄板鍋！豆板醤ベースのピリ辛鍋で、追加のにんにくチップは場面に合わせて抜いてもOK😆💕<br>雰囲気の良い掘りごたつや個室もあるので合コンにもピッタリ👌人気のお店なので予約してから行くべし😼✨ <a href="https://t.co/hMUvDHL409">pic.twitter.com/hMUvDHL409</a></p>&mdash; ももちゃん (@shosha__girl) <a href="https://twitter.com/shosha__girl/status/852121206945861632">2017年4月12日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',852121206945861632);
insert into taglog(tag,tweet,tweetId) values ('タグはまだない', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">【恵比寿 espresso d works】<br>NYスタイルのエスプレッソカフェ💕<br>オススメは何と言ってもリコッタチーズをふんだんに使ったフワッフワのパンケーキ😽💕<br>夕方からは店内の照明が落とされて一気に大人な雰囲気に👌クラシカルなムードが漂う店内になるからカップルにもオススメ🤗 <a href="https://t.co/aAaxB2jHEq">pic.twitter.com/aAaxB2jHEq</a></p>&mdash; ももちゃん (@shosha__girl) <a href="https://twitter.com/shosha__girl/status/851769348280655873">2017年4月11日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',851769348280655873);
